import React, { useState, useEffect } from 'react';
import {useHistory } from "react-router-dom";
import '../css/NavBar.css';
import {
    Link
  } from "react-router-dom";


  import Box from '@mui/material/Box';
import BottomNavigation from '@mui/material/BottomNavigation';
import BottomNavigationAction from '@mui/material/BottomNavigationAction';

let NavBar = () =>{
    const [value, setValue] = React.useState(0);

    return<>
    
    <nav>
        <img className='logo' src="/images/kostas_mazarakis.jpg" alt="fg" />
        <h3 className='mt-4'>Konstantinos Mazarakis</h3>
        <p className='mb-4'>FULLSTACK DEVELOPER</p>
        <BottomNavigationAction className='nv' label="Recents"></BottomNavigationAction>
        <Link to="/about" className='nv'>About</Link>
        <Link className='nv'>Projects</Link>
        <Link className='nv'>Skills</Link>
        <Link className='nv'>Education</Link>
        <Link className='nv'>Certifications</Link>
        <Link className='nv'>Contact</Link>
        
        <Box sx={{ width: 500 }}>
      <BottomNavigation showLabelsvalue={value}onChange={(event, newValue) => {setValue(newValue);}}>
        <BottomNavigationAction label="Recents" />
        <BottomNavigationAction label="Favorites"  />
        <BottomNavigationAction label="Nearby"  />
      </BottomNavigation>
    </Box>
        

        
    </nav>
    </>
    
}
export default NavBar
